import React from 'react';
import propTypes from "prop-types"


import "./Time.scss"

const Time = ({ isMe, isReaded }) => {
    isMe &&
        (isReaded ? (
            <img
                className='message__icon-readed'
                src={readedSvg}
                alt='Readed icon'
            />) : (
            <img
                className='message__icon-readed message__icon-readed--no'
                src={noReadedSvg}
                alt='No readed icon'
            />
        ))
}

Time.propTypes = {
    date: propTypes.string
}

export default Time;
